css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.bungie.net") {

div.bgRepeat { 
background: url(data:image/png;base64,) repeat-y bottom right !important; 
height:100% !important; 
}
div.bgRepeatAdmin { 
background: url(data:image/png;base64,) repeat-y bottom right !important; 
overflow: hidden !important;
}
body.loaded { 
background: #20425e url(data:image/png;base64,) fixed repeat-x top left !important; 
margin:0 !important; 
font: bold 12px/15px Arial, Helvetica, sans-serif !important; 
color: #bbb !important; 
visibility: visible !important; 
}
}
